import College from "./College";
const Collegelist=()=>
{
    const myclgdata=[
        {clgname: "bansal", clgdata:"we providevari"},
        {clgname: "radhe", clgdata:"we providevari my data"},
        {clgname: "ramclg", clgdata:"we providevari ramclg"}
    ];

    return(
        <>
        <h2>college list</h2>
        <div class="row">
             {myclgdata.map((clgkey)=> <College cname={clgkey.clgname}
             cdata={clgkey.clgdata} />)}
         </div>
        </>
    );
}   
export default Collegelist;
